import Layout from '../../components/Layout';
import Private from '../../components/auth/Private';

const UserIndex = () => {
    return (
        <Layout>
            <Private>
                <div className="container-fluid">
                    <h2>User Dashboard 2</h2>
                </div>
            </Private>
        </Layout>
    );
};

export default UserIndex;
